function GetLetterFromPercent(percent)
   {
      var letter="";
      var lettertbl=['A+','A','A-','B+','B','B-','C+','C','C-','D+','D','D-','F'];
      var percenttbl=[97,93,90,87,83,80,77,73,70,67,63,60,0];

      for(var i=0; i<percenttbl.length; i++)
         if( percent>=percenttbl[i] )
         {
            letter = lettertbl[i];
            break;
         }
      return letter;
   }

function Calc()
   {
      var hours,igrade,grade,iweight,weight;

      var glook=[-1,4.33,4.00, 3.67, 3.33, 3.00, 2.67, 2.33, 2.00, 1.67, 1.33, 1.00, 0.67, 0, -1, -1];
      var wlook=[0,0.5,1,1,1];
      var gpa=0;
      var sum=0;
      var txt1="";
      var txt2="";
      for(var i=1; i<=irow+1; i++)
      {
         hours = $("#tbl > tbody > tr:nth-child("+i+") > td:nth-child(3) > input").val();
         igrade = $("#tbl > tbody > tr:nth-child("+i+") > td:nth-child(2) > select").prop("selectedIndex");
         iweight = $("#tbl > tbody > tr:nth-child("+i+") > td:nth-child(4) > select").prop("selectedIndex");
         hours = parseFloat(hours);
         weight = wlook[iweight];
         grade = glook[igrade]+weight;
         if( hours>0 && grade>=0 )
         {
            gpa+=hours*grade;
            sum+=hours;
            txt1+=hours+"\u00D7"+grade+"+";
            txt2+=hours+"+";
         }
      }
      cgpa=$("#cgpa").val();
      chours=$("#chours").val();
      cgpa = parseFloat(cgpa);
      chours = parseFloat(chours);
      if( cgpa>=0 && chours>0 )
      {
         gpa+=chours*cgpa;
         sum+=chours;
         txt1+=chours+"\u00D7"+cgpa+"+";
         txt2+=chours+"+";
      }
      gpa/=sum;
      gpa=gpa.toFixed(2);
      txt1=txt1.slice(0, -1);
      txt2=txt2.slice(0, -1);
      var txt="("+txt1+") / ("+txt2+") = "+gpa;
      $("#gpa").val(gpa);
      $("#total").val(sum);
      $("#area").val(txt);
      var percent=(100*gpa/4.33).toFixed(2);
      if( percent>100 ) percent=100;
      $("#gpacircle").percircle({percent: percent,text: gpa});
   }

function fcalc() 
   {
      var out1 = out2 = '';
      var s=1;
      var w=xctl.value;
      var n=nctl.value;
      var d=dctl.value;
      if( !isFrac(w,n,d) )
      {
         alert("Please enter fraction values");
         return;
      }
      if( w=='-' ) { s=-1; w='0'; }
      if( w=='' ) w='0';
      w = parseInt(w);
      n = parseInt(n);
      d = parseInt(d);
      if( w==0 && (n/d)<0 ) s=-1;
      n = Math.abs(n);
      d = Math.abs(d);
      if( w!=0 )
      {
         nctl.value=n;
         dctl.value=d;
      }
      if( w<0 ) { s=-1; w=-w; }

      n1 = n+d*w;
      g = gcd(n1,d);
      sign='';
      if( s==-1 ) sign = '-';

      out = 'gcf('+n1+','+d+') = '+g;
      out += '\n';
      if( w!=0 ) out+=w+' ';
      out += n+'/'+d;
      if( w!=0 )
      {
         out += '\n= ';
         out += sign+n1+'/'+d;
      }
      n2=n1;
      d2=d;
      td32ctl.style.display="none";
      td33ctl.style.display="none";
      td34ctl.style.display="none";
      td42ctl.style.display="none";
      if( g>1 )
      {
         out += '\n= ';
         out += sign+'('+n1+'/'+g+')/('+d+'/'+g+')';
         n2 = n1/g;
         d2 = d/g;
         out += '\n= ';
         out += sign+n2+'/'+d2;
      }
      if( n1>d )
      {
         i=Math.floor(n1/d);
         j = Math.abs(n2)-Math.abs(i*d2);
         if( j!=0 ) {
            out += '\n= ';
            out += sign+i+' '+j+'/'+d2;
            td32ctl.style.display="table-cell";
            td33ctl.style.display="table-cell";
            td34ctl.style.display="table-cell";
            td42ctl.style.display="table-cell";
            t = sign+i;
            x3ctl.value=t;
            n4ctl.value=j;
            d4ctl.value=d2;
         }
      }
      n3ctl.value=sign+n2;
      d3ctl.value=d2;
      out += '\n= ';
      out += sign+roundresult(n2/d2);
      out += '\n= ';
      out += sign+roundresult(n2/d2*100)+'%';
      areactl.value=out;

      var obj = document.getElementById("frac");
      CircNumber(obj,{
         n: w,
         num: n,
         den: d,
         radius: 20,
         fillColor: "rgb(80,192,0)",
         lineWidth: 1
      });
      var d=document.querySelectorAll("#calcform>div:nth-child(n+4)");
      for(var i=0; i<d.length; i++)
         d[i].style.display="block";
   }

