			s = parseFloat(s);
			l = parseFloat(l);
			if( h<0 ) h=0;
			if( s<0 ) s=0;
			if( l<0 ) l=0;
			if( h>=360 ) h=359;
			if( s>100 ) s=100;
			if( l>100 ) l=100;
			s/=100;
			l/=100;
