function getDigit(s) 
   {
      var n=['IV','IX','XL','XC','CD','CM','I','V','X','L','C','D','M'];
      var v=[4, 9, 40, 90, 400, 900, 1, 5, 10, 50, 100, 500, 1000];
      var len;
      for(var i=0; i<n.length; i++) {
         len = n[i].length;
         if( s.substring(0,len)==n[i] )
            return [v[i], len, n[i]];
      }
      return [0, 0, 0];
   }

